import './App.css';
import Form from "./components/UI/Form/Form";
import {Button} from "react-bootstrap";
import React from "react";

function App() {
  return (
    <div className="App">
        <Form>
            <Button as="a" variant="primary"> Submit </Button>
        </Form>
    </div>
  );
}

export default App;
